import {Link} from 'react-router-dom';

const DUMMY_EVENTS = [
  {
    id: 'e1',
    title: 'first event'
  },
  {
    id: 'e2',
    title: 'second event'
  }
]

function EventsPage() {
    return (
      <>
      <h1>EventsPage</h1>
      <ul>
        {DUMMY_EVENTS.map(event => <li key={event.id}>
          {/* reletive link - event.id appended to currently active routes path */}
          <Link to={event.id}>{event.title}</Link> 
        </li>)}
      </ul>
      </>
    )
  }

  export default EventsPage
